function Contact(){
    return (
        <div className="contact">
          <h3>Contact</h3>
          <p>GitHub: <a href="https://github.com/swojas" target="_blank" rel="noopener noreferrer">Swojas</a></p>
          <p>Email: <a href = "mailto: swojas12@gmail.com">Send Email</a></p>
        </div>
    );
}

export default Contact;
